import React, { useState } from "react";
import {
  TextField,
  Button,
  Box,
  Typography,
  Paper,
  Radio,
  RadioGroup,
  FormControl,
  FormControlLabel,
} from "@mui/material";
import {
  encrypt as aesEncrypt,
  decrypt as aesDecrypt,
} from "../algorithms/AES/aes";
import EncryptionSteps from "./EncryptionSteps";

function CipherForm() {
  const [key, setKey] = useState("");
  const [text, setText] = useState("");
  const [result, setResult] = useState("");
  const [mode, setMode] = useState("encrypt");
  const [encryptionSteps, setEncryptionSteps] = useState([]);
  const [activeStep, setActiveStep] = useState(0);
  const inputText = String(text).trim();
  const inputKey = String(key).trim();

  const stringToHex = (str) => {
    return Array.from(str)
      .map((c) => c.charCodeAt(0).toString(16).padStart(2, "0"))
      .join("");
  };

  const hexToString = (hex) => {
    if (!hex) return "";
    const bytes = hex.match(/.{1,2}/g) || [];
    return bytes
      .map((byte) => String.fromCharCode(parseInt(byte, 16)))
      .join("");
  };

  const isHexString = (str) => {
    const hexRegex = /^[0-9a-fA-F]+$/;
    return hexRegex.test(str.replace(/\s+/g, ""));
  };

  const handleEncrypt = () => {
    let inputText = String(text).trim();
    let inputKey = String(key).trim();
    let flag = false;

    try {
      // Convert text to hex if not already hex
      if (!isHexString(inputText)) {
        flag = true;
        inputText = stringToHex(inputText);
        console.log("Converted text to hex:", inputText);
      }

      // Convert key to hex if not already hex
      if (!isHexString(inputKey)) {
        inputKey = stringToHex(inputKey);
        console.log("Converted key to hex:", inputKey);
      }

      // Validate key length (16 bytes = 32 hex chars)
      if (inputKey.length !== 32) {
        throw new Error("Key must be 16 bytes (32 hex characters) for AES-128");
      }

      let output;
      if (mode === "encrypt") {
        const result = aesEncrypt(inputText, inputKey);
        output = result.ciphertext;
        setEncryptionSteps(result.steps);
      } else {
        output = aesDecrypt(inputText, inputKey);
      }

      // Convert result back if input was text
      if (flag) {
        setResult(hexToString(output));
      } else {
        setResult(output);
      }
    } catch (error) {
      console.error("Encryption error:", error);
      alert(error.message);
    }
  };
  return (
    <Box sx={{ width: "100%", p: 3 }}>
      <Typography variant="h4" gutterBottom>
        AES Encryption
      </Typography>
      <TextField
        label="Input Text"
        value={text}
        onChange={(e) => setText(e.target.value)}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Key"
        value={key}
        onChange={(e) => setKey(e.target.value)}
        fullWidth
        margin="normal"
      />
      <FormControl component="fieldset" sx={{ mt: 2 }}>
        <RadioGroup row value={mode} onChange={(e) => setMode(e.target.value)}>
          <FormControlLabel
            value="encrypt"
            control={<Radio />}
            label="Encrypt"
          />
          <FormControlLabel
            value="decrypt"
            control={<Radio />}
            label="Decrypt"
          />
        </RadioGroup>
      </FormControl>
      <Button
        variant="contained"
        color="primary"
        onClick={handleEncrypt}
        sx={{ mt: 2 }}
      >
        {mode === "encrypt" ? "Encrypt" : "Decrypt"}
      </Button>
      {result && (
        <Paper sx={{ mt: 4, p: 3 }}>
          <Typography variant="h6">Result</Typography>
          <Typography variant="body1">{result}</Typography>
        </Paper>
      )}
      {encryptionSteps.length > 0 && (
        <EncryptionSteps
          steps={encryptionSteps}
          activeStep={activeStep}
          setActiveStep={setActiveStep}
        />
      )}
    </Box>
  );
}

export default CipherForm;
